export class Audi extends Component {



    componentDidMount() {
        fetch('./cars.json').then(response => {
            return response.json();
        }).then(data => {
            console.log(data);
        }).catch(err => {
            // Do something for an error here
            console.log("Error Reading data " + err);
        });
    }

    render() {

        return (
            <div>

            </div>
        )
    }
}

export default Audi
